  true,\n\t\"url\": null,\n\t\"notes\": \"<p>2003 to 2013.  CMS compiles claims data
  for Medicare and Medicaid patients across a variety of categories and years. This
  includes Inpatient and Outpatient claims, Master Beneficiary Summary Files, and
  many other files. Indicators from this data source have been computed by personnel
  in CDC's Division for Heart Disease and Stroke Prevention (DHDSP).  This dataset
  is one of the datasets provided by National Cardiovascular Disease Surveillance
  System. The system is designed to integrate multiple indicators from many data sources
  to provide a comprehensive picture of the public health burden of CVDs and associated
  risk factors in the United States. The data are organized by location (national,
  state, county, and selected sites) and indicator. The data can be plotted as trends
  and stratified by sex and race/ethnicity.</p>n\",\n\t\"license_title\": \"Other
